yle="font-size:24px"><span style="font-family:dekko">Click&nbsp;the button of the amount you choose</span></span></span></p>\r\n\r\n			<p><span style="color:#000000"><span style="font-size:24px"><span style="font-family:dekko">This will take you to the Paypal website</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="5" style="width:1275px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:488px"><span style="font-size:36px"><span style="color:#008000"><span style="font-family:dekko">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;$5</span></span></span></td>\r\n			<td class="rtecenter" style="width:287px">\r\n			<p><span style="color:#000000"><span style="font-size:22px"><strong><span style="font-family:dekko">(Only make one deposit)</span></strong></span><span style="font-size:22px"><strong><span style="font-family:dekko">&nbsp;</span></strong></span></span></p>\r\n			</td>\r\n			<td colspan="3" style="width:491px"><span style="font-size:36px"><span style="color:#008000"><span style="font-family:dekko">&nbsp; &nbsp; $20</span></span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','','full_html');
INSERT INTO `field_revision_body` VALUES ('node','page','0','6','6','und','0','<iframe src="https://calendar.google.com/calendar/embed?src=ufweightwinners%40gmail.com&ctz=America/New_York" style="border: 0" width="1000" height="600" frameborder="0" scrolling="no"></iframe>','','php_code'),('node','page','0','13','13','und','0','<table align="center" border="0" cellpadding="1" cellspacing="1" style="width:1289px">\r\n	<tbody>\r\n		<tr>\r\n			<td class="rtecenter" colspan="7" style="width:1393px">\r\n			<p><span style="font-size:48px"><strong><span style="font-family:dekko"><span style="color:#800080">Make&nbsp;Your&nbsp;Deposit To Start the Game</span></span></strong></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="7" style="width:1393px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="5" rowspan="1" style="width:1280px">\r\n			<p><strong><span style="color:#008000"><span style="font-size:28px"><span style="font-family:dekko">If you meet your goal&nbsp;you get your deposit back</span></span></span></strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="5" style="width:1280px">\r\n			<p><strong><span style="color:#008000"><span style="font-size:28px"><span style="font-family:dekko">plus an equal share of the losers'' deposits!</span></span></span></strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="5" style="width:1280px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:495px">&nbsp;</td>\r\n			<td class="rtecenter" style="width:252px"><span style="color:#000000"><span style="font-size:28px"><span style="font-family:dekko">How much would you like to deposit?</span></span></span></td>\r\n			<td colspan="3" style="width:523px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:495px">&nbsp;</td>\r\n			<td class="rtecenter" style="width:252px">&nbsp;</td>\r\n			<td colspan="3" style="width:523px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="5" rowspan="1" style="width:1280px">\r\n			<p><span style="color:#000000"><span style="font-size:24px"><span style="font-family:dekko">Click the button&nbsp;of the amount you choose</span></span></span></p>\r\n\r\n			<p><span style="color:#000000"><span style="font-size:24px"><span style="font-family:dekko">This will take you to the PayPal website</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="5" rowspan="1" style="width:1280px">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:495px"><span style="font-size:36px"><span style="color:#008000"><span style="font-family:dekko">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $5</span></span></span></td>\r\n			<td class="rtecenter" style="width:252px"><span style="color:#000000"><span style="font-size:22px"><strong><span style="font-family:dekko">(Only make one deposit)</span></strong></span></span></td>\r\n			<td colspan="3" style="width:523px"><span style="font-size:36px"><span style="color:#008000"><span style="font-family:dekko">&nbsp; &nbsp; &nbsp; &nbsp; $20</span></span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','','full_html');
INSERT INTO `field_revision_body` VALUES ('node','page','0','16','16','und','0','<p><span style="color:#000000"><span style="font-family:dekko"><strong><span style="font-size:20px">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></strong></span></span></p>\r\n\r\n<table align="center" border="0" cellpadding="0" cellspacing="0" style="width:1323px">\r\n	<tbody>\r\n		<tr>\r\n			<td class="rtecenter" colspan="3" style="width:1319px">\r\n			<p><span style="font-size:48px"><span style="color:#800080"><strong><span style="font-family:dekko">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Welcome to the UF Weight Winners Game!</span></strong></span></span></p>\r\n\r\n			<p><span style="font-size:28px"><span style="color:#800080"><strong><span style="font-family:dekko">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Here''s how to play:&nbsp;</span></strong></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:525px"><span style="font-size:26px"><span style="color:#FF9900"><strong><span style="font-family:dekko">1) First, Make Your Deposit</span></strong></span></span></td>\r\n			<td class="rtecenter" style="width:339px">&nbsp;</td>\r\n			<td class="rtecenter" style="width:451px"><span style="font-size:26px"><span style="color:#008000"><strong><span style="font-family:dekko">2) And Automatically Earn Bonus Money!</span></strong></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:525px"><span style="color:#000000"><span style="font-size:16px">Go to the&nbsp;<strong>Let''s Play</strong> page to see your deposit options. Click the one you want and make your deposit using PayPal. Remember, you have to make a deposit by the deadline to play!&nbsp;</span></span></td>\r\n			<td class="rtecenter" style="width:339px">&nbsp;</td>\r\n			<td class="rtecenter" style="width:451px">\r\n			<p><span style="color:#000000"><span style="font-size:16px">After you make your deposit, we''ll put&nbsp;<strong>$5</strong>&nbsp;back into your PayPal account just for participating! You''ll earn another bonus</span></span><span style="color:#000000"><span style="font-size:16px">&nbsp;<strong>$5 </strong>after you complete your final weigh-in!&nbsp;</span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:525px"><img alt="" height="83" src="sites/default/files/pictures/paypal.jpg" width="241" /></td>\r\n			<td class="rtecenter" style="width:339px">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td class="rtecenter" style="width:451px"><span style="color:rgb(0, 0, 0)"><span style="font-size:20px"><span style="font-size:18px"><img alt="" height="108" src="sites/default/files/pictures/5dollars.png" width="130" /></span></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="3" style="width:616px"><span style="font-size:26px"><span style="color:#0099ff"><strong><span style="font-family:dekko">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;3) Next, Choose a Healthy Weight Loss Strategy</span></strong></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:525px">&nbsp;</td>\r\n			<td class="rtecenter" style="width:339px"><span style="font-size:16px">The <strong>Weight Loss Tips</strong> page has links to resources that you can use to safely lose weight. These include engaging in physcial activity, eating healthy, and drinking lots of water. Choose whichever option you like best. Or, better yet, use them all!</span></td>\r\n			<td class="rtecenter" style="width:451px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:525px"><span style="color:#4B0082"><strong><span style="font-size:22px"><span style="font-family:dekko">&nbsp;</span></span></strong></span><span style="color:#800080"><strong><span style="font-size:22px"><span style="font-family:dekko">&nbsp;</span></span></strong></span></td>\r\n			<td class="rtecenter" style="width:339px">\r\n			<table align="center" border="0" cellpadding="0" cellspacing="0" style="width:287px">\r\n				<tbody>\r\n					<tr>\r\n						<td style="width:104px"><img alt="" height="111" src="sites/default/files/pictures/runningshoes.png" width="193" /></td>\r\n						<td style="width:98px">\r\n						<div>\r\n						<p><img alt="" height="136" src="sites/default/files/pictures/lettuce.jpg" width="173" />​</p>\r\n						</div>\r\n						</td>\r\n						<td style="width:78px"><img alt="" height="160" src="sites/default/files/pictures/water.jpg" width="110" /></td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n			<td class="rtecenter" style="width:451px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:525px"><span style="font-size:26px"><span style="color:#FF0000"><strong><span style="font-family:dekko">4) Then, Lose Weight, Update Your Page, and Track Your Progress</span></strong></span></span></td>\r\n			<td class="rtecenter" style="width:339px">&nbsp;</td>\r\n			<td class="rtecenter" style="width:451px"><span style="font-size:26px"><span style="color:#FF3E87"><strong><span style="font-family:dekko">5) Provide Support to Other Players Along the Way</span></strong></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:525px"><span style="font-size:16px">Everyone has 4 weeks after the game starts to lose at least 4% of their body weight. Be sure to keep track of your weight loss using the&nbsp;<strong>Update My Weight</strong>&nbsp;and the <strong>My Weight Progress</strong> pages!</span></td>\r\n			<td class="rtecenter" style="width:339px">&nbsp;</td>\r\n			<td class="rtecenter" style="width:451px"><span style="font-size:16px">Chat with other players, post comments, and ask the UF Weight Winners team any questions you have on the <strong>Chat &amp; Announcements</strong> page!</span></td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="1" style="width:525px">\r\n			<div>\r\n			<p><img alt="" height="150" src="sites/default/files/pictures/scale1.jpg" width="150" />​</p>\r\n			</div>\r\n			</td>\r\n			<td class="rtecenter" style="width:339px">&nbsp;</td>\r\n			<td class="rtecenter" style="width:451px">\r\n			<div>\r\n			<p><img alt="" height="137" src="sites/default/files/pictures/smileyface" width="163" />​</p>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="3" style="width:616px"><span style="font-size:26px"><span style="color:#800080"><strong><span style="font-family:dekko">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;6) Last, Complete the Final Weigh-In to Get Your Earnings!</span></strong></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="1" style="width:525px">&nbsp;</td>\r\n			<td class="rtecenter" colspan="1" style="width:339px"><span style="font-size:16px">Your scheduled final weigh-in appointment will show up on the&nbsp;<strong>Calendar</strong>&nbsp;page, along with other important game dates. After you complete the final weigh-in, you will get your </span><span style="color:#000000"><span style="font-size:16px"><strong>$5 </strong>bonus just for finishing the study. If you meet your weight loss goal, you''ll also get your deposit back plus any extra earnings!&nbsp;</span></span><span style="font-size:16px">&nbsp;</span></td>\r\n			<td class="rtecenter" style="width:451px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="1" style="width:525px"><img alt="" height="125" src="sites/default/files/pictures/videoconferencing.jpg" style="float:right" width="188" /></td>\r\n			<td class="rtecenter" colspan="1" rowspan="2" style="width:339px"><img alt="" height="251" src="sites/default/files/pictures/winning.jpg" width="252" /></td>\r\n			<td class="rtecenter" style="width:451px"><img alt="" height="161" src="sites/default/files/pictures/bagmoney.png" style="float:left" width="106" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="1" style="width:525px">&nbsp;</td>\r\n			<td class="rtecenter" style="width:451px">&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','','full_html');
INSERT INTO `field_revision_body` VALUES ('node','page','0','21','21','und','0','<table align="center" border="0" cellpadding="0" cellspacing="0" style="width:991px">\r\n	<tbody>\r\n		<tr>\r\n			<td class="rtecenter" style="width:987px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:987px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:987px">\r\n			<p><span style="font-family:dekko"><span style="font-size:28px"><span style="color:#000000">Welcome!&nbsp;</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:987px"><span style="font-size:22px"><span style="font-family:dekko"><span style="color:#000000">Only authorized users have access to website content.</span></span></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:987px"><span style="font-size:22px"><span style="font-family:dekko"><span style="color:#000000">Please Login with your username and password.</span></span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p class="rtecenter">&nbsp;</p>\r\n','','full_html'),('node','page','0','25','25','und','0','<table align="center" border="0" cellpadding="0" cellspacing="0" style="width:1316px">\r\n	<tbody>\r\n		<tr>\r\n			<td class="rtecenter" colspan="3" style="width:433px">\r\n			<p><span style="font-size:48px"><strong><span style="color:#800080"><span style="font-family:dekko">Choose the methods&nbsp;which fit&nbsp;you best</span></span></strong></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="3" style="width:433px">\r\n			<p><span style="font-size:24px"><span style="color:#000000"><strong><span style="font-family:dekko">Click the pictures below to find more information about healthy weight loss strategies</span></strong></span></span></p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="3" style="width:433px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:415px">\r\n			<h1><span style="font-size:36px"><span style="font-family:dekko"><span style="color:#FF0000">Eat Healthy</span></span></span></h1>\r\n			</td>\r\n			<td class="rtecenter" style="width:482px">\r\n			<h1><span style="font-size:36px"><span style="color:#008000"><span style="font-family:dekko">Exercise</span></span></span></h1>\r\n			</td>\r\n			<td class="rtecenter" style="width:411px">\r\n			<h1><span style="font-size:36px"><span style="font-family:dekko"><span style="color:#0099ff">Drink Water</span></span></span></h1>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:415px">&nbsp;</td>\r\n			<td class="rtecenter" style="width:482px">&nbsp;</td>\r\n			<td class="rtecenter" style="width:411px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:415px">\r\n			<p style="text-align:center"><a href="https://www.heart.org/HEARTORG/HealthyLiving/HealthyEating/Healthy-Eating_UCM_001188_SubHomePage.jsp" target="_blank"><img alt="" height="127" src="sites/default/files/pictures/AHALogo.png" width="213" /></a></p>\r\n\r\n			<p class="rtecenter">&nbsp;</p>\r\n\r\n			<p class="rtecenter"><span style="font-size:22px"><span style="font-family:dekko"><span style="color:#FF0000">Dining&nbsp;out, cooking recipes, and other wieght loss strategies</span></span></span></p>\r\n			</td>\r\n			<td style="width:482px">\r\n			<p style="text-align:center"><a href="http://www.diabetes.org/food-and-fitness/fitness/get-and-stay-fit/" target="_blank"><img alt="" height="130" src="sites/default/files/pictures/ADALogo.png" width="130" /></a></p>\r\n\r\n			<p class="rtecenter">&nbsp;</p>\r\n\r\n			<p class="rtecenter"><span style="font-size:22px"><span style="font-family:dekko"><span style="color:#008000">Get and stay fit by setting a goal and making a plan</span></span></span></p>\r\n			</td>\r\n			<td style="width:411px">\r\n			<p style="text-align:center"><a href="http://www.cdc.gov/healthywater/drinking/nutrition/index.html" target="_blank"><img alt="" height="132" src="sites/default/files/pictures/CDCLogo.jpg" width="180" /></a></p>\r\n\r\n			<p class="rtecenter">&nbsp;</p>\r\n\r\n			<p class="rtecenter"><span style="font-size:22px"><span style="font-family:dekko"><span style="color:#0099ff">Drinking enough water can help you manage your weight</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:415px">&nbsp;</td>\r\n			<td style="width:482px">&nbsp;</td>\r\n			<td class="rtecenter" style="width:411px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:415px">&nbsp;</td>\r\n			<td style="width:482px">&nbsp;</td>\r\n			<td class="rtecenter" style="width:411px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:415px">\r\n			<p style="text-align:center"><a href="http://www.mayoclinic.org/healthy-lifestyle/nutrition-and-healthy-eating/in-depth/healthy-eating-plan/art-20044905" target="_blank"><img alt="" height="101" src="sites/default/files/pictures/MCLogo.jpg" width="93" /></a></p>\r\n\r\n			<p class="rtecenter">&nbsp;</p>\r\n\r\n			<p class="rtecenter"><span style="font-size:22px"><span style="font-family:dekko"><span style="color:#FF0000">Explore healthy eating options using the pyramid or plate methods</span></span></span></p>\r\n			</td>\r\n			<td style="width:482px">\r\n			<p style="text-align:center"><a href="http://www.weightwatchers.com/util/art/index_art.aspx?tabnum=1&amp;art_id=685&amp;sc=3040" target="_blank"><img alt="" height="103" src="sites/default/files/pictures/WWLogo.jpg" width="258" /></a></p>\r\n\r\n			<p class="rtecenter">&nbsp;</p>\r\n\r\n			<p class="rtecenter"><span style="font-size:22px"><span style="font-family:dekko"><span style="color:#008000">Twelve quick workout tips for work or home</span></span></span></p>\r\n			</td>\r\n			<td style="width:411px">\r\n			<p style="text-align:center"><a href="http://www.cheatsheet.com/health-fitness/the-magic-time-to-drink-water-for-weight-loss.html/?a=viewall" target="_blank"><img alt="" height="92" src="sites/default/files/pictures/CSLogo.png" width="273" /></a></p>\r\n\r\n			<p class="rtecenter">&nbsp;</p>\r\n\r\n			<p class="rtecenter"><span style="font-size:22px"><span style="font-family:dekko"><span style="color:#0099ff">The best time and best waters to drink</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','','full_html');
INSERT INTO `field_revision_body` VALUES ('node','webform','0','26','26','und','0','<table align="center" border="0" cellpadding="0" cellspacing="0" style="width:1332px">\r\n	<tbody>\r\n		<tr>\r\n			<td class="rtecenter" rowspan="4" style="width:321px">\r\n			<p><img alt="" height="230" src="sites/default/files/pictures/scale.jpg" width="410" /></p>\r\n\r\n			<p>&nbsp;</p>\r\n			</td>\r\n			<td class="rtecenter" rowspan="4" style="width:14px">&nbsp;</td>\r\n			<td class="rtecenter" style="width:510px">\r\n			<p><span style="font-size:48px"><strong><span style="color:#800080"><span style="font-family:dekko">Did you know?</span></span></strong></span></p>\r\n			</td>\r\n			<td class="rtecenter" colspan="2" style="width:477px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:510px">\r\n			<p>&nbsp;</p>\r\n\r\n			<p><span style="color:#000000"><span style="font-size:26px"><span style="font-family:dekko">Players who update their weight regularly are more likely to win!</span></span></span></p>\r\n			</td>\r\n			<td class="rtecenter" colspan="2" style="width:477px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" rowspan="2" style="width:510px">​</td>\r\n			<td class="rtecenter" colspan="2" rowspan="2" style="width:477px">\r\n			<p>&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','','full_html'),('node','page','0','32','32','und','0','<table align="center" border="0" cellpadding="1" cellspacing="1" style="width:1284px">\r\n	<tbody>\r\n		<tr>\r\n			<td class="rtecenter" colspan="7" style="width:1393px">\r\n			<p><span style="font-size:48px"><strong><span style="font-family:dekko"><span style="color:#800080">Make&nbsp;Your&nbsp;Deposit To Start the Game</span></span></strong></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="7" style="width:1393px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="5" style="width:1275px"><strong><span style="color:#008000"><span style="font-size:28px"><span style="font-family:dekko">If you deposit $5 and meet your goal</span></span></span></strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="5" style="width:1275px"><strong><span style="color:#008000"><span style="font-size:28px"><span style="font-family:dekko">you get your deposit back</span></span></span></strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="5" style="width:1275px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="5" style="width:1275px">\r\n			<table align="center" border="0" cellpadding="1" cellspacing="1" style="width:1276px">\r\n				<tbody>\r\n					<tr>\r\n						<td class="rtecenter" colspan="5" style="width:1268px"><strong><span style="color:#008000"><span style="font-size:28px"><span style="font-family:dekko">If you deposit $20 and meet your goal</span></span></span></strong></td>\r\n					</tr>\r\n					<tr>\r\n						<td class="rtecenter" colspan="5" style="width:1268px"><strong><span style="color:#008000"><span style="font-size:28px"><span style="font-family:dekko">you get your deposit back plus an equal share of the losers'' deposits!</span></span></span></strong></td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="5" style="width:1275px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:488px">&nbsp;</td>\r\n			<td class="rtecenter" style="width:287px"><span style="color:#000000"><span style="font-size:28px"><span style="font-family:dekko">How much would you like to deposit?</span></span></span></td>\r\n			<td colspan="3" style="width:491px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:488px">&nbsp;</td>\r\n			<td class="rtecenter" style="width:287px">&nbsp;</td>\r\n			<td colspan="3" style="width:491px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="5" rowspan="1" style="width:1275px">\r\n			<p><span style="color:#000000"><span style="font-size:24px"><span style="font-family:dekko">Click&nbsp;the button of the amount you choose</span></span></span></p>\r\n\r\n			<p><span style="color:#000000"><span style="font-size:24px"><span style="font-family:dekko">This will take you to the Paypal website</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" colspan="5" style="width:1275px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td class="rtecenter" style="width:488px"><span style="font-size:36px"><span style="color:#008000"><span style="font-family:dekko">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;$5</span></span></span></td>\r\n			<td class="rtecenter" style="width:287px">\r\n			<p><span style="color:#000000"><span style="font-size:22px"><strong><span style="font-family:dekko">(Only make one deposit)</span></strong></span><span style="font-size:22px"><strong><span style="font-family:dekko">&nbsp;</span></strong></span></span></p>\r\n			</td>\r\n			<td colspan="3" style="width:491px"><span style="font-size:36px"><span style="color:#008000"><span style="font-family:dekko">&nbsp; &nbsp; $20</span></span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n','','full_html');
