INSERT INTO `variable` VALUES ('user_default_timezone','s:1:"2";'),('user_email_verification','i:1;'),('user_mail_cancel_confirm_body','s:381:"[user:name],\r\n\r\nA request to cancel your account has been made at [site:name].\r\n\r\nYou may now cancel your account on [site:url-brief] by clicking this link or copying and pasting it into your browser:\r\n\r\n[user:cancel-url]\r\n\r\nNOTE: The cancellation of your account is not reversible.\r\n\r\nThis link expires in one day and nothing will happen if it is not used.\r\n\r\n--  [site:name] team";'),('user_mail_cancel_confirm_subject','s:59:"Account cancellation request for [user:name] at [site:name]";'),('user_mail_password_reset_body','s:366:"Hello participant #[user:name],\r\n\r\nA request to reset your password has been made. You may now log-in by clicking this temporary link or copying and pasting it to your browser:\r\n\r\n[user:one-time-login-url]\r\n\r\nThis link can only be used once and it will expire after one day. Please contact us if you have any further questions.\r\n\r\nBest Regards,\r\nThe [site:name] Team";'),('user_mail_password_reset_subject','s:61:"Password Recovery for Participant #[user:name] at [site:name]";'),('user_mail_register_admin_created_body','s:681:"Hello,\r\n\r\nThank you for participating in our online weight loss game! We have created a personalized account for you on the UF Weight Winners website. Your username is [user:name]. \r\n\r\nYou may now login to the website by clicking this link or copying and pasting it into your browser:\r\n[user:one-time-login-url]\r\n\r\nThis link can only be used once. After you login the first time, you will be asked to create your own password. For security purposes, your password is encrypted and only you will be able to change it. Once you have set your password, that will be what you use to login to the website along with your username ([user:name]).\r\n\r\nThank you again!\r\nThe [site:name] Team";'),('user_mail_register_admin_created_subject','s:29:"Welcome to UF Weight Winners!";'),('user_mail_register_no_approval_required_body','s:450:"[user:name],\r\n\r\nThank you for registering at [site:name]. You may now log in by clicking this link or copying and pasting it to your browser:\r\n\r\n[user:one-time-login-url]\r\n\r\nThis link can only be used once to log in and will lead you to a page where you can set your password.\r\n\r\nAfter setting your password, you will be able to log in at [site:login-url] in the future using:\r\n\r\nusername: [user:name]\r\npassword: Your password\r\n\r\n--  [site:name] team";');
