DROP TABLE IF EXISTS `video_queue`;
CREATE TABLE `video_queue` (   `vid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Video id, the primary identifier',   `fid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The file_managed.fid being referenced in this field.',   `entity_type` varchar(128) DEFAULT 'node' COMMENT 'The entity_type of the video.',   `entity_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'The entity_id being referenced in this field.',   `status` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Status of the transcoding, possible values are 1, 5, 10, 20',   `dimensions` varchar(255) DEFAULT '' COMMENT 'The dimensions of the output video.',   `duration` varchar(32) DEFAULT NULL COMMENT 'Stores the video duration in Sec.',   `started` int(11) NOT NULL DEFAULT '0' COMMENT 'Start timestamp of transcodings',   `completed` int(11) NOT NULL DEFAULT '0' COMMENT 'Transcoding completed timestamp',   `statusupdated` int(10) unsigned NOT NULL DEFAULT '0' COMMENT 'Timestamp of last status update, used to track stuck videos',   `data` longblob COMMENT 'A serialized array of converted files.',   PRIMARY KEY (`vid`),   KEY `status` (`status`),   KEY `file` (`fid`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Store video transcoding queue.' AUTO_INCREMENT=1;
