lized array of additional options for the e-mail configuration, including value mapping for the TO and FROM addresses for select lists.',   `status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT 'Whether this email is enabled.',   PRIMARY KEY (`nid`,`eid`) ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Holds information regarding e-mails that should be sent...';
